import React, {Component} from 'react';



const Profile = (props) => {
    return (
        <div className="profile">
            <div id="profilePic">
                <img src={props.profilePic} alt="Profile Pic"/>
            </div>
            <div id="profileName">
                <h4>{props.profileName}</h4>
            </div>
        </div>
    )
}

export default Profile;
